function List(props: any) {
  const [fName, setFName] = useState(props.peopleList.attributes.first_name);
  const [lName, setLName] = useState(props.peopleList.attributes.last_name);
  const dispatch = useAppDispatch();

  useEffect(() => {
    dispatch(fetchCarLists());
  }, [dispatch]);

